import React, { useEffect, useState } from "react";
import "../../App.css";
import Fade from 'react-reveal/Fade';
import Typist from "react-typist";
import "../Styles/Experience.css";
import styled from "styled-components";

const ButtonGroup = styled.div`
display: flex;
`

const Button = styled.button`
  font: 1.3rem Inconsolata, monospace;
  background-color: green;
  color: white;
  font-size: 20px;
  padding: 30px 60px;
  border-radius: 5px;
  margin: 10px 0px;
  display:block;
  margin:0 auto;
  
  cursor: pointer;
  &:disabled {
    color: grey;
    opacity: 0.7;
    cursor: default;
  }
`;
class Experience extends React.Component {

  render(){
   
  return (
    
      <div className="exp-container" > 
          <Typist className="exp-header">
          
          /experience
          </Typist>
        
          <ButtonGroup>
            <Button> Florida Polytechnic University | Dept. of Computer Science </Button>
            <Button> Florida Polytechnic University | Student Affairs </Button>
            <Button> CNP Agency </Button>
            <Button> Florida Polytechnic University | Office of Admissions </Button>
          </ButtonGroup>
        
      </div>
    
  );}
}
export default Experience;
